import { ADD_ROW, DELETE_ROW } from "./constants"

export const addRow = () =>{
    return {
        type : ADD_ROW
    }
}

export const deletRow = (id=0) =>{
    return {
        type : DELETE_ROW,
        payload : id
    }
}

export const editRow = (id=0) =>{
    return {
        type : DELETE_ROW,
        payload : id
    }
}

export const increment = () =>{
    return {
        type : 'increment',
        payload : 1
    }
}
